package de.fivethree.immoapps.backend.model.payload.res.property.app;

import de.fivethree.immoapps.backend.model.payload.res.user.GetUserResponse;

import java.util.List;

public class GetAppContextResponse {
    private GetHausverwalterAppResponse hausverwalter;
    private List<GetUserResponse> mitarbeiter;

    public GetAppContextResponse(GetHausverwalterAppResponse hausverwalter, List<GetUserResponse> mitarbeiter) {
        this.hausverwalter = hausverwalter;
        this.mitarbeiter = mitarbeiter;
    }

    public GetHausverwalterAppResponse getHausverwalter() {
        return hausverwalter;
    }

    public void setHausverwalter(GetHausverwalterAppResponse hausverwalter) {
        this.hausverwalter = hausverwalter;
    }

    public List<GetUserResponse> getMitarbeiter() {
        return mitarbeiter;
    }

    public void setMitarbeiter(List<GetUserResponse> mitarbeiter) {
        this.mitarbeiter = mitarbeiter;
    }
}
